import React, { Fragment } from 'react'

export const About = () => {
    return (
        <Fragment>
            <h1>About ~This App</h1>
            <p>UnOfficial App to Search Github users</p>
            <p>Version: 1.0.0</p>
        </Fragment>
    )
}

export default About
